  bugs: 12,
  defectos: 6,
  mejoras: 6,
  bugsAbiertos: 12,
  bugsCerrados: 0,
  bugsCancelados: 0,
  
  resultados: {
    passed: 12,
    failed: 8,
    pending: 1,
    total: 21
