  porcentajes: {
    passed: 57.1,
    failed: 38.1,
    pending: 4.8
  },
  
  testerData: [
    {
      nombre: "Federico",
      passed: 2,
      pending: 0,
      failed: 6
    },
    {
      nombre: "Leonel",
      passed: 5,
      pending: 1,
      failed: 4
    },
    {
      nombre: "Ramiro",
      passed: 5,
      pending: 0,
      failed: 1
    }
  ]
};

export default testingData;
